import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

const random = Math.trunc(Math.random() * 6) + 1;
console.log(random);

const user = {
  name: "Hedy Lamarr",
  imageUrl: "https://i.imgur.com/yXOvdOSs.jpg",
  imageSize: 90,
};

const produce = [
  {
    name: "Banana",
    isFruit: true,
    id: 1,
  },
  {
    name: "Tomato",
    isFruit: true,
    id: 2,
  },
  {
    name: "Carrot",
    isFruit: false,
    id: 3,
  },
];

export default function App() {
  const listItems = produce.map((produce) => (
    <li key={produce.id} style={{ color: produce.isFruit ? "pink" : "maroon" }}>
      {produce.name}
    </li>
  ));
  return <ol>{listItems}</ol>;
}
